      Assertions._assert(A.mapping.equals(B.mapping));
    }
  }
  if (A.S == null) {
    return (B.S == null) ? OrdinalSet.<T>empty() : new OrdinalSet<T>(B.S,B.mapping);
  }
 else   if (B.S == null) {
