    return true;
  }
  int wordDiff=wordDiff(offset,other.offset);
  int i=0;
  for (; i < -wordDiff; i++) {
    if (other.bits[i] != 0) {
      return false;
    }
  }
  int min=Math.min(bits.length,other.bits.length + wordDiff);
  for (; i < min; i++) {
    if ((bits[i] & ~other.bits[i - wordDiff]) != 0) {
      return false;
    }
  }
  for (; i < bits.length; i++) {
    if (bits[i] != 0) {
      return false;
    }
  }
  return true;
}

