  queue.offer(subtree);
  while (!queue.isEmpty()) {
    final Element node=queue.poll();
    final NodeList children=node.getChildNodes();
    for (int i=0; i < children.getLength(); i++) {
      if (children.item(i).getNodeType() == Node.ELEMENT_NODE) {
        queue.offer((Element)children.item(i));
      }
